import React, { Component } from 'react';

const tableData = [
    {
        id: 1,
        userName: "SvenBrand1985",
        emailId: "svenbrand1985@email.com",
        status: "Active",
        Revenue: "$ 1,402.56",
        comment: "Add comment..."
    },
    {
        id: 2,
        userName: "AlexDavids45",
        emailId: "alexdavids45@email.com",
        status: "Disabled",
        Revenue: "$ 892.46",
        comment: "Brief text comment"
    },
    {
        id: 3,
        userName: "Sandy333",
        emailId: "sandy333@email.com",
        status: "Active",
        Revenue: "$ 873.00",
        comment: "Add comment..."
    },
    {
        id: 4,
        userName: "SveDevonHillnBrand1985",
        emailId: "devonhill@email.com",
        status: "Active",
        Revenue: "$ 401.24",
        comment: "Add comment..."
    },
    {
        id: 5,
        userName: "EdwardHorton",
        emailId: "edwardhorton@email.com",
        status: "Active",
        Revenue: "$ 302.56",
        comment: "Add comment..."
    },
    {
        id: 6,
        userName: "Megan145",
        emailId: "megan145@email.com",
        status: "Disabled",
        Revenue: "$ 200.01",
        comment: "Add comment..."
    },
    {
        id: 7,
        userName: "Charles654432",
        emailId: "charles654432@email.com",
        status: "Active",
        Revenue: "$ 104.80",
        comment: "Add comment..."
    },
    {
        id: 8,
        userName: "AnnSmith",
        emailId: "annsmith@email.com",
        status: "Active",
        Revenue: "$ 98.15",
        comment: "Add comment..."
    }
];

const tableHead = ["Username", "E-mail", "Status", "Revenue", "Comment"];
const selectAll = true;
const checkBoxObj = tableData.reduce((acc, d) => (acc["chbx" + d.name] = selectAll, acc), {});
class tableDense extends Component {
    constructor(props) {
      super(props) //since we are extending class Table so we have to use super in order to override Component class constructor
        this.state = { //state is by default an object
            tableData,
            selectAll,
            checkBoxObj,
            tableHead
        };
      this.toggleAllChange = this.toggleAllChange.bind(this);
      this.toggleOneChange = this.toggleOneChange.bind(this);
    }
    toggleAllChange(event) {
        const selectAll = event.target.checked;

        const newCheckBoxObj = {};
        for(let k in this.state.checkBoxObj) {
            newCheckBoxObj[k] = selectAll;
        }

        this.setState({
            checkBoxObj: newCheckBoxObj,
            selectAll
        });
    }

    toggleOneChange(event) {
        const target = event.target;
        const value = target.checked;
        const name = target.name;

        const newCheckBoxObj = { ...this.state.checkBoxObj, [name]: value };

        const selectAll = Object.values(newCheckBoxObj).every(chk => chk);


        this.setState({
            checkBoxObj: newCheckBoxObj,
            selectAll
        });
    }
    render() {
         const filteredDatas = this.state.tableData;
        return (

            <div className="table-responsive bordered-table mb-60">
                <div className="table-header">
                    <div className="h6">Table Header</div>
                    <div className="button">
                        <div className="sort-icon">

                        </div>
                        <div className="dots-icon">

                        </div>
                    </div>
                </div>
                <table className="table-dense">
                    <thead>
                        <tr>
                            <th style={{width:"20px"}}>
                                <div className="custom-checkbox small">
                                    <input type="checkbox"
                                    value="checkAll"
                                    style={{ marginRight: 5 }}
                                    // checked={this.state.selectAll}
                                    onChange={this.toggleAllChange.bind(this)}/>{" "}
                                    <label for="all"></label>      
                                </div>
                            </th>
                            {tableHead.map(data => (
                                <th key={data} className="text-gray text-left">{data}</th>
                            ))}
                        </tr>
                    </thead>
                    <tbody>    
                        {filteredDatas.map((data) => {
                            return <tr key={data.id}>
                                        <td key={data.i}>
                                            <div className="custom-checkbox small">
                                                <input type="checkbox" className="chbx"
                                                id={"chbx" + data.name}
                                                name={"chbx" + data.name}
                                                // checked={this.state.checkBoxObj["chbx" + data.name]}
                                                onChange={this.toggleOneChange.bind(this)}/>
                                                <label for="all"></label>      
                                            </div>
                                        </td>
                                        <td>{data.userName}</td>
                                        <td>{data.emailId}</td>
                                        <td>{data.status}</td>
                                        <td>{data.Revenue}</td>
                                        <td>{data.comment}</td>
                                    </tr>
                        })}
                    </tbody>
                </table>
            </div>
        );
    }
}

export default tableDense;
